(33, 'box2', 'a:1:{s:7:\"English\";s:23:\"Banner Logo | Home Page\";}', 'a:1:{s:7:\"English\";s:27:\"Dental Compliance made easy\";}', '', 'a:1:{s:7:\"English\";s:11:\"Get Started\";}', '', 'box/2023/02/208-20230218085202-0-nav_logo.png', 1),
(34, 'box3', 'a:1:{s:7:\"English\";s:24:\"Section no 1 | Home Page\";}', 'a:1:{s:7:\"English\";s:36:\"Why Use Dental Community Compliance? how to use it\";}', 'a:1:{s:7:\"English\";s:609:\"Our goal at Dental community Compliance Is to provide you and your start with tools to easily Keep your practice up to date wth all compliance regulations. Use the features in our platform to keep your staff informed of the latest updates, organized with their daily, weekly, monthly and yearly tasks and provide them with easy to follow checklist and audits. Keep all of you SDS sheets stored electronically for easy access and all of your manuals stored digitally for staff review. Allow your office managers to track team morale and automate weekly check ins, to make sure everyone on the team feels heard.\";}', '', '', '', 1),
(35, 'box4', 'a:1:{s:7:\"English\";s:35:\"(Compliance Dashboard) |  Home Page\";}', 'a:1:{s:7:\"English\";s:20:\"Compliance Dashboard\";}', 'a:1:{s:7:\"English\";s:584:\"<p>Embrace a paperless approach with our revolutionary online Compliance Portal. Streamline your practice&#39;s compliance management, stay up-to-date with regulatory changes, enhance staff training, and effortlessly sail through inspections. Join our exclusive Compliance Membership program and benefit from expert guidance and support provided by our dedicated Compliance Team. As a bonus, enjoy access to GDC verified CPD courses, free of charge, for all your staff members. Discover a new era of compliance efficiency and excellence with our comprehensive suite of services.</p>\r\n\";}', '', '', 'box/2023/06/116-20230630165336-32-2023-06-30_10-47-29.png', 1),
(36, 'box5', 'a:1:{s:7:\"English\";s:33:\"(Compliance Calendar) | Home Page\";}', 'a:1:{s:7:\"English\";s:19:\"Compliance Calendar\";}', 'a:1:{s:7:\"English\";s:381:\"Go paperless with our online Compliance Portal, helping your practice to manage compliance more efficiently, keep updated with any changes to regulations, and staff training and ultimately pass inspections with ease. Our Compliance Membership programme includes advice and support from our dedicated Compliance Team and complimentary GDC verified CPD courses for all of your staff.\";}', '', '', 'box/2023/06/357-20230630165358-32-2023-06-30_10-46-58.png', 1),
(37, 'box6', 'a:1:{s:7:\"English\";s:25:\"(SDS Storage) | Home Page\";}', 'a:1:{s:7:\"English\";s:11:\"SDS Storage\";}', 'a:1:{s:7:\"English\";s:381:\"Go paperless with our online Compliance Portal, helping your practice to manage compliance more efficiently, keep updated with any changes to regulations, and staff training and ultimately pass inspections with ease. Our Compliance Membership programme includes advice and support from our dedicated Compliance Team and complimentary GDC verified CPD courses for all of your staff.\";}', '', '', 'box/2023/06/313-20230630165513-32-2023-06-30_10-48-38.png', 1),
(38, 'box7', 'a:1:{s:7:\"English\";s:29:\"(Employee Morale) | Home Page\";}', 'a:1:{s:7:\"English\";s:24:\"Employee Morale Tracking\";}', 'a:1:{s:7:\"English\";s:381:\"Go paperless with our online Compliance Portal, helping your practice to manage compliance more efficiently, keep updated with any changes to regulations, and staff training and ultimately pass inspections with ease. Our Compliance Membership programme includes advice and support from our dedicated Compliance Team and complimentary GDC verified CPD courses for all of your staff.\";}', '', '', 'box/2023/06/980-20230630165731-32-2023-06-30_10-48-00.png', 1),
(39, 'box8', 'a:1:{s:7:\"English\";s:33:\"(Learn More Button) | Home Button\";}', '', '', 'a:1:{s:7:\"English\";s:10:\"Learn More\";}', '', '', 1),
(40, 'box9', 'a:1:{s:7:\"English\";s:34:\"(Book a Demo Button) | Home Button\";}', '', '', 'a:1:{s:7:\"English\";s:11:\"Book a Demo\";}', '', '', 1),
(41, 'box10', 'a:1:{s:7:\"English\";s:34:\"(Compliance Manager)  | Home Phone\";}', 'a:1:{s:7:\"English\";s:18:\"Compliance Manager\";}', 'a:1:{s:7:\"English\";s:1053:\"<div class=\"c_manger_contain wow rollIn\">\r\n<p>Our cloud-based Compliance Manager portal has been developed by leading industry professionals to effectively help you to manage your dental compliance using a completely paper free svstem The followind features are includad</p>\r\n</div>\r\n\r\n<div class=\"c_manger_contain wow rollIn\" data-wow-delay=\"0.5s\">\r\n<p>A compliance suite, complete with personalised policies and online forms and checklists</p>\r\n</div>\r\n\r\n<div class=\"c_manger_contain wow rollIn\" data-wow-delay=\"1.5s\">\r\n<p>A staff training and recruitment matrix to manage and store your teams portfolios online</p>\r\n</div>\r\n\r\n<div class=\"c_manger_contain wow rollIn\" data-wow-delay=\"2s\">\r\n<p>An interactive calendar to schedule your compliance activities. A dashboard to alert you for any changes to documents as well as a metric system to manage your practice performance</p>\r\n</div>\r\n\r\n<div class=\"c_manger_contain wow rollIn\" data-wow-delay=\"2.5s\">\r\n<p>Exclusive discounts for members for additional services such as mock Inspections</p>\r\n</div>\r\n\";}', '', '', 'box/2023/02/620-20230218130701-0-compilance_manager_img.png', 1),
(42, 'box11', 'a:1:{s:7:\"English\";s:24:\"(section 11) | Home Page\";}', 'a:1:{s:7:\"English\";s:44:\"Over 2000 happy users have joined us to date\";}', 'a:1:{s:7:\"English\";s:2313:\"<div class=\"general-density wow flipInX\" data-wow-duration=\"0.5s\"><img alt=\"\" src=\"https://php8.imdemo.xyz/dental_community/uploads/images/implant_icon.png\" style=\"height: 50px; width: 50px;\" />\r\n<h3>HR Management</h3>\r\n\r\n<p>Competently parallel task researched data process.</p>\r\n</div>\r\n\r\n<div class=\"general-density wow flipInX\" data-wow-duration=\"1s\"><img alt=\"\" src=\"https://php8.imdemo.xyz/dental_community/uploads/images/tooth.png\" style=\"height: 50px; width: 50px;\" />\r\n<h3>Customers Register</h3>\r\n\r\n<p>Leverage other resource leveling convergence data.</p>\r\n</div>\r\n\r\n<div class=\"general-density wow flipInX\" data-wow-duration=\"1.5s\"><img alt=\"\" src=\"https://php8.imdemo.xyz/dental_community/uploads/images/teeth.png\" style=\"height: 50px; width: 50px;\" />\r\n<h3>Employee Login</h3>\r\n\r\n<p>Engage fully tested process top line platform clients.</p>\r\n</div>\r\n\r\n<div class=\"general-density wow flipInX\" data-wow-duration=\"2s\"><img alt=\"\" src=\"https://php8.imdemo.xyz/dental_community/uploads/images/tooth-extraction.png\" style=\"height: 50px; width: 50px;\" />\r\n<h3>HR dashboard</h3>\r\n\r\n<p>User generated content in real time offshoring.</p>\r\n</div>\r\n\r\n<div class=\"general-density wow flipInX\" data-wow-duration=\"2.5s\"><img alt=\"\" src=\"https://php8.imdemo.xyz/dental_community/uploads/images/whiting-tooth.png\" style=\"width: 50px; height: 50px\" />\r\n<h3>HR Calendar</h3>\r\n\r\n<p>Incubate standards great channels scalable benefits.</p>\r\n</div>\r\n\r\n<div class=\"general-density wow flipInX\" data-wow-duration=\"3s\"><img alt=\"\" src=\"https://php8.imdemo.xyz/dental_community/uploads/images/dental-implant.png\" style=\"height: 50px; width: 50px;\" />\r\n<h3>Stock Management</h3>\r\n\r\n<p>Synthesize integrated schemas with networks.</p>\r\n</div>\r\n\r\n<div class=\"general-density wow flipInX\" data-wow-duration=\"3.5s\"><img alt=\"\" src=\"https://php8.imdemo.xyz/dental_community/uploads/images/teeth.png\" style=\"height: 50px; width: 50px;\" />\r\n<h3>Rota Management</h3>\r\n\r\n<p>Revolutionize global sources through dental services.</p>\r\n</div>\r\n\r\n<div class=\"general-density wow flipInX\" data-wow-duration=\"4s\"><img alt=\"\" src=\"https://php8.imdemo.xyz/dental_community/uploads/images/tooth.png\" style=\"width: 50px; height: 50px\" />\r\n<h3>Leaves Management</h3>\r\n\r\n<p>Evisculate holistic innovation rather than centric data.</p>\r\n</div>\r\n\";}', 'a:1:{s:7:\"English\";s:20:\"View detail solution\";}', '', '', 1),
