(223, 'Account register email', 'admin', NULL, 'Dental Community ', 'webmaster', '', '', 'Thank you {{name}} for your registration on dentalcommunity.com', 'Greetings&nbsp;<b>{{name}} ,</b><br />\r\n<br />\r\nWe appreciate you taking the time to register your account with Dental Community Compliance. We kindly recommend updating your profile and taking a moment to review the &quot;Getting Started&quot; video for a smooth experience.<br />\r\n<br />\r\nThank you once again, and please don&#39;t hesitate to reach out if you have any questions or need further assistance.<br />\r\n<br />\r\nEmail :&nbsp;<b>{{email}}</b><br />\r\nPassword :&nbsp;<b>{{pass}}</b><br />\r\n&nbsp;', 'Greeting&nbsp;<b>{{name}} ,</b><br />\r\n<br />\r\nWe appreciate you taking the time to register your account with Dental Community Compliance. We kindly recommend updating your profile and taking a moment to review the &quot;Getting Started&quot; video for a smooth experience.<br />\r\n<br />\r\nThank you once again, and please don&#39;t hesitate to reach out if you have any questions or need further assistance.<br />\r\n<br />\r\nEmail :&nbsp;<b>{{email}}</b><br />\r\nPassword :&nbsp;<b>{{pass}}</b><br />\r\n&nbsp;', 'signUp', 1, '0000-00-00 00:00:00'),
(225, 'Account Verification', 'admin', NULL, 'Account Verification', 'webmaster', '', '', 'Account Verification', 'Dear {{name}}!<br />\r\nThank you for your registration On {{webName}}<br />\r\nPlease verify your account from the link below<br />\r\n{{link}}<br />\r\nYour verification code is : {{code}};', 'Dear {{name}}!<br />\r\nThank you for your registration On {{webName}}<br />\r\nPlease verify your account from the link below<br />\r\n{{link}}<br />\r\nYour verification code is : {{code}};', 'verifyEmail', 0, '0000-00-00 00:00:00'),
(228, 'Account Created On New Order', 'admin', NULL, 'Dental Community ', 'webmaster', '', '', 'Welcome to Smart Dental, {{name}}', '<span style=\"font-size:16px;\"><strong>Welcome {{name}}, your new account is ready.</strong></span><br />\r\n<br />\r\nWelcome to Dental Community Compliance! To make sure you have the best experience possible, we kindly suggest updating your profile and checking out our &quot;Getting Started&quot; video. It&#39;s packed with helpful tips and tricks to ensure everything goes smoothly.<br />\r\n<br />\r\nThank you for joining our compliance community. Remember, we&#39;re here for you, so don&#39;t hesitate to reach out if you have any questions or need any assistance along the way.<br />\r\n<br />\r\n<a href=\"https://www.youtube.com/\">https://www.youtube.com/</a><br />\r\n<br />\r\nUsername:&nbsp;{{email}}<br />\r\nPassword:&nbsp;{{password}}<br />\r\nPin:&nbsp;{{pin}}<br />\r\n<br />\r\nHere is the link to login&nbsp;<a href=\"\">Dental Community</a>', '<span style=\"font-size:16px;\"><strong>Welcome {{name}}, your new account is ready.</strong></span><br />\r\n<br />\r\nTo make sure you have the best experience possible, we kindly suggest updating your profile and checking out our &quot;Getting Started&quot; video. It&#39;s packed with helpful tips and tricks to ensure everything goes smoothly.<br />\r\n<br />\r\nOnce again, thank you for joining our community. Remember, we&#39;re here for you, so don&#39;t hesitate to reach out if you have any questions or need any assistance along the way.<br />\r\n<br />\r\n<a href=\"https://www.youtube.com/\">https://www.youtube.com/</a><br />\r\n<br />\r\nUsername:&nbsp;{{email}}<br />\r\nPassword:&nbsp;{{password}}<br />\r\nPin:&nbsp;{{pin}}<br />\r\n<br />\r\nHere is the link for login&nbsp;<a href=\"\">Dental Community</a>', 'accountCreateOnOrder', 1, '0000-00-00 00:00:00'),
(229, 'Account Password Trouble Shooting {{name}}, {{email}}, {{password}},{{webName}}', 'admin', NULL, 'Forget your password for Dental Community ', 'webmaster', '', '', 'Password Recovery', 'Hi {{name}}<br />\r\n<br />\r\nYour username is as follows: {{email}}<br />\r\nThe password is as follows:{{password}}<br />\r\n<br />\r\n<a href=\"\">LOGIN BY CLICK HERE</a>', 'Hi {{name}}<br />\r\n<br />\r\nYour username is as follows: {{email}}<br />\r\nThe password is as follows:{{password}}<br />\r\n<br />\r\n<a href=\"\">LOGIN BY CLICK HERE</a>', 'accountTrouble', 1, '0000-00-00 00:00:00'),
(247, 'After Career Form Submit', 'admin', NULL, 'Dental Community ', 'webmaster', '', '', 'Thank you for submitting career form', 'Hello&nbsp;<span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">{{name}} ,</span><br />\r\n<br />\r\nThank you for submitting our career form!<br />\r\nWe will contact you if needed.', 'Hello&nbsp;<span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">{{name}} ,</span><br />\r\n<br />\r\nThank you for submitting our career form!<br />\r\nWe will contact you if needed.', 'careerFormSubmit', 0, '0000-00-00 00:00:00'),
(248, 'After Feedback Form Submit', 'admin', NULL, 'Dental Community ', 'webmaster', '', '', 'Thank you for your request', 'Hello&nbsp;<span font-size:=\"\" helvetica=\"\" style=\"font-family: \">{{name}} ,</span><br />\r\n<br />\r\nThank you for submitting our career form!<br />\r\nWe will contact you if needed.', 'Hello&nbsp;<span font-size:=\"\" helvetica=\"\" style=\"font-family: \">{{name}} ,</span><br />\r\n<br />\r\nThank you for submitting our career form!<br />\r\nWe will contact you if needed.', 'feedbackFormSubmit', 0, '0000-00-00 00:00:00'),
(249, 'After Inquiry Form Submit', 'admin', NULL, 'Dental Community ', 'webmaster', '', '', 'Thank you for your request', 'Hello&nbsp;<span font-size:=\"\" helvetica=\"\" style=\"font-family: \">{{name}} ,</span><br />\r\n<br />\r\nThank you for submitting our inquiry form!<br />\r\nWe will contact you soon.', 'Hello&nbsp;<span font-size:=\"\" helvetica=\"\" style=\"font-family: \">{{name}} ,</span><br />\r\n<br />\r\nThank you for submitting our inquiry form!<br />\r\nWe will contact you soon.', 'inquiryFormSubmit', 1, '0000-00-00 00:00:00'),
(251, 'Initial Health Form', 'admin', NULL, 'Dental Community ', 'webmaster', '', '', 'Initial Compliance Health Check Form', 'Hello {{name}},<br />\r\n<br />\r\nCongratulations! You have successfully completed the Initial Compliance Health Check form. Well done! Now, it&#39;s time to head over to the dashboard and check on your health status.<br />\r\n<br />\r\nTake a moment to explore the dashboard and see how you&#39;re doing. It&#39;s a great way to keep track of your compliance progress and ensure everything is in tip-top shape.<br />\r\n<br />\r\nKeep up the great work, and if you have any questions or need any assistance, feel free to reach out. We&#39;re here to support you every step of the way.', 'Hello {{name}},<br />\r\n<br />\r\nCongratulations! You have successfully completed the Initial Compliance Health Check form. Well done! Now, it&#39;s time to head over to the dashboard and check on your health status.<br />\r\n<br />\r\nTake a moment to explore the dashboard and see how you&#39;re doing. It&#39;s a great way to keep track of your compliance progress and ensure everything is in tip-top shape.<br />\r\n<br />\r\nKeep up the great work, and if you have any questions or need any assistance, feel free to reach out. We&#39;re here to support you every step of the way.', 'healthEmail', 1, '0000-00-00 00:00:00'),
(252, 'Task Assigned to User ', 'user', NULL, 'Dental Community ', 'webmaster', '', '', 'Task Assigned DCC', 'Fantastic news! You&#39;ve been assigned a new task on Dental Community Compliance called &lt;span style=&quot;color: rgb(52, 53, 65); font-family: S&ouml;hne, ui-sans-serif, system-ui, -apple-system, &quot; segoe=&quot;&quot; ui&quot;,=&quot;&quot; roboto,=&quot;&quot; ubuntu,=&quot;&quot; cantarell,=&quot;&quot; &quot;noto=&quot;&quot; sans&quot;,=&quot;&quot; sans-serif,=&quot;&quot; &quot;helvetica=&quot;&quot; neue&quot;,=&quot;&quot; arial,=&quot;&quot; &quot;apple=&quot;&quot; color=&quot;&quot; emoji&quot;,=&quot;&quot; &quot;segoe=&quot;&quot; ui=&quot;&quot; symbol&quot;,=&quot;&quot; emoji&quot;;=&quot;&quot; font-size:=&quot;&quot; 16px;=&quot;&quot; white-space-collapse:=&quot;&quot; preserve;&quot;=&quot;&quot;&gt;({{title}}). It&#39;s time to log in and showcase your skills. Show them what you&#39;re made of and let your expertise shine through! You&#39;ve got this!<br />\r\n<br />\r\nHere is the link to login&nbsp;<a href=\"\">Dental Community</a>', 'Fantastic news! You&#39;ve been assigned a new task on Dental Community Compliance called&nbsp;&lt;span style=&quot;color: rgb(52, 53, 65); font-family: S&ouml;hne, ui-sans-serif, system-ui, -apple-system, &quot; segoe=&quot;&quot; ui&quot;,=&quot;&quot; roboto,=&quot;&quot; ubuntu,=&quot;&quot; cantarell,=&quot;&quot; &quot;noto=&quot;&quot; sans&quot;,=&quot;&quot; sans-serif,=&quot;&quot; &quot;helvetica=&quot;&quot; neue&quot;,=&quot;&quot; arial,=&quot;&quot; &quot;apple=&quot;&quot; color=&quot;&quot; emoji&quot;,=&quot;&quot; &quot;segoe=&quot;&quot; ui=&quot;&quot; symbol&quot;,=&quot;&quot; emoji&quot;;=&quot;&quot; font-size:=&quot;&quot; 16px;=&quot;&quot; white-space-collapse:=&quot;&quot; preserve;&quot;=&quot;&quot;&gt;({{title}}) . It&#39;s time to log in and showcase your skills. Show them what you&#39;re made of and let your expertise shine through! You&#39;ve got this!<br />\r\n<br />\r\nHere is the link to login&nbsp;<a href=\"\">Dental Community</a>', 'uevent', 1, '0000-00-00 00:00:00'),
(253, 'Task sent back by user', 'user', NULL, 'Dental Community ', 'webmaster', '', '', 'Task Completed by {{name}}', 'It&#39;s a wrap! Your team member has successfully completed the task &quot;{{title}}&quot; assigned to them and has sent it back to you. Now it&#39;s your turn to log on to Dental Community Compliance and check it out! Head on over and see the amazing work that&#39;s been done.\r\n<div>&nbsp;</div>\r\n\r\n<div><span style=\"font-size: 13px; color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, &quot;Trebuchet MS&quot;;\">Here is the link to login&nbsp;</span><a href=\"https://php8.imdemo.xyz/dental_community/myAdmin/-email?page=emailContent&amp;editId=228\" style=\"color: rgb(7, 130, 193); font-size: 13px; font-family: sans-serif, Arial, Verdana, &quot;Trebuchet MS&quot;;\">Dental Community</a></div>\r\n', '<span style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium;\">It&#39;s a wrap! Your team member has successfully completed the task &quot;{{title}}&quot; assigned to them and has sent it back to you. Now it&#39;s your turn to log on to Dental Community Compliance and check it out! Head on over and see the amazing work that&#39;s been done.</span>\r\n<div style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium;\">&nbsp;</div>\r\n\r\n<div style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium;\"><span style=\"font-size: 13px; color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, &quot;Trebuchet MS&quot;;\">Here is the link to login&nbsp;</span><a href=\"https://php8.imdemo.xyz/dental_community/myAdmin/-email?page=emailContent&amp;editId=228\" style=\"font-size: 13px; font-family: sans-serif, Arial, Verdana, &quot;Trebuchet MS&quot;;\">Dental Community</a></div>\r\n', 'event', 1, '0000-00-00 00:00:00'),
(254, '1st Warning', 'user', NULL, 'Dental Community ', 'webmaster', '', '', 'Compliance Health in Danger', 'You in danger gurrl. Your dental health meter is in red. Let&rsquo;s keep out of the red.<br />\r\n<br />\r\nLog on to the software and update your compliance activities through the activity calendar. Download the outstanding compliance activities from the compliance templates, complete and upload on the activity calendar. Or simply click on the compliance activity and fill the electronic form.<br />\r\n<br />\r\nRemember &lsquo;Best Practice Starts Here&rsquo;', 'You in danger gurrl. Your dental health meter is in red. Let&rsquo;s keep out of the red.<br />\r\n<br />\r\nLog on to the software and update your compliance activities through the activity calendar. Download the outstanding compliance activities from the compliance templates, complete and upload on the activity calendar. Or simply click on the compliance activity and fill the electronic form.<br />\r\n<br />\r\nRemember &lsquo;Best Practice Starts Here&rsquo;', '1warn', 0, '0000-00-00 00:00:00'),
(255, '2nd Warning', 'user', NULL, 'Dental Community ', 'webmaster', '', '', 'Compliance Health in Danger', 'Hulk Out! Your compliance health meter is still in the red. Time to be a hero.<br />\r\n<br />\r\nWhat does this mean?<br />\r\nLog on to the software and update your compliance activities through the activity calendar. Download the outstanding compliance activities from the compliance templates, complete and upload on the activity calendar. Or simply click on the compliance activity and fill the electronic form.', 'Hulk Out! Your compliance health meter is still in the red. Time to be a hero.<br />\r\n<br />\r\nWhat does this mean?<br />\r\nLog on to the software and update your compliance activities through the activity calendar. Download the outstanding compliance activities from the compliance templates, complete and upload on the activity calendar. Or simply click on the compliance activity and fill the electronic form.', '2warn', 0, '0000-00-00 00:00:00'),
(256, '3rd Warning', 'user', NULL, 'Dental Community ', 'webmaster', '', '', 'Compliance Health in Danger', 'Wake Up! Your compliance health meter has been in the red for 3 weeks. Be near your phone.<br />\r\n<br />\r\nNext Step :<br />\r\nSince your compliance, health has been in red for 1 month, it&rsquo;s time for us to give you a call and just check on you. A notification is also being sent to the practice owner to see if they can help.', 'Wake Up! Your compliance health meter has been in the red for 3 weeks. Be near your phone.<br />\r\n<br />\r\nNext Step :<br />\r\nSince your compliance, health has been in red for 1 month, it&rsquo;s time for us to give you a call and just check on you. A notification is also being sent to the practice owner to see if they can help.', '3warn', 0, '0000-00-00 00:00:00'),
(257, 'Message To Owners', 'admin', NULL, 'Dental Community ', 'webmaster', '', '', 'Practice\'s Compliance Health ', 'Greetings from Dental Community Compliance!<br />\r\n<br />\r\nWe wanted to provide you with an important update regarding your practice&#39;s compliance health. Unfortunately, it hasn&#39;t been in the best shape for the past four weeks.<br />\r\n<br />\r\nNow, they need your invaluable help and skills to turn things around. It&#39;s crucial that you schedule some time with them to address and resolve all the outstanding issues promptly. Your expertise can make a significant difference.<br />\r\n<br />\r\nThank you for your attention to this matter. Let&#39;s work together to ensure your practice&#39;s compliance is back on track!', 'Greetings from Dental Community Compliance!<br />\r\n<br />\r\nWe wanted to provide you with an important update regarding your practice&#39;s compliance health. Unfortunately, it hasn&#39;t been in the best shape for the past four weeks.<br />\r\n<br />\r\nNow, they need your invaluable help and skills to turn things around. It&#39;s crucial that you schedule some time with them to address and resolve all the outstanding issues promptly. Your expertise can make a significant difference.', 'mto', 1, '0000-00-00 00:00:00'),
(258, 'Performance Review', 'admin', NULL, 'Dental Community ', 'webmaster', '', '', 'Performance Review', 'Hey there!<br />\r\n<br />\r\nIt&#39;s that time again for your weekly check-in! How exciting is that? Get ready to provide valuable feedback and insights. All you need to do is log on to Dental Community Compliance and follow the instructions from the Dashboard. It&#39;s going to be a breeze!<br />\r\n<br />\r\nHave fun with the process and don&#39;t hesitate to reach out if you have any questions. Embrace this opportunity to contribute and make a difference!<br />\r\n<br />\r\nHere is the link to login&nbsp;<a href=\"https://php8.imdemo.xyz/dental_community/myAdmin/-email?page=emailContent&amp;editId=228\">Dental Community</a>', 'Hey there!<br />\r\n<br />\r\nIt&#39;s that time again for your weekly check-in! How exciting is that? Get ready to provide valuable feedback and insights. All you need to do is log on to Dental Community Compliance and follow the instructions from the Dashboard. It&#39;s going to be a breeze!<br />\r\n<br />\r\nHave fun with the process and don&#39;t hesitate to reach out if you have any questions. Embrace this opportunity to contribute and make a difference!<br />\r\n<br />\r\nHere is the link to login&nbsp;<a href=\"https://php8.imdemo.xyz/dental_community/myAdmin/-email?page=emailContent&amp;editId=228\">Dental Community</a>', 'review', 1, '0000-00-00 00:00:00'),
(259, 'Booking Form', 'admin', NULL, 'Dental Community ', 'webmaster', '', '', 'Booking Form', 'We greatly appreciate your interest in Dental Community Compliance. Your inquiry has been received, and we want to assure you that we value your time and consideration. Our dedicated representative will personally reach out to you in the near future to provide you with the information you need and address any questions or concerns you may have.<br />\r\n<br />\r\nWe understand the importance of clear communication and prompt responses, so please rest assured that we are working diligently to connect with you as soon as possible. In the meantime, if you have any additional information or specific requirements that you would like us to know, please feel free to share them with us.<br />\r\n<br />\r\nThank you once again for reaching out, and we look forward to speaking with you soon.', 'We greatly appreciate your interest in our product/service. Your inquiry has been received, and we want to assure you that we value your time and consideration. Our dedicated representative will personally reach out to you in the near future to provide you with the information you need and address any questions or concerns you may have.<br />\r\n<br />\r\nWe understand the importance of clear communication and prompt responses, so please rest assured that we are working diligently to connect with you as soon as possible. In the meantime, if you have any additional information or specific requirements that you would like us to know, please feel free to share them with us.<br />\r\n<br />\r\nThank you once again for reaching out, and we look forward to speaking with you soon.', 'bookingForm', 1, '0000-00-00 00:00:00'),
(260, 'Delegate Form', 'admin', NULL, 'Dental Community ', 'webmaster', '', '', 'Delegate Form', 'We greatly appreciate your interest in our product/service. Your inquiry has been received, and we want to assure you that we value your time and consideration. Our dedicated representative will personally reach out to you in the near future to provide you with the information you need and address any questions or concerns you may have.<br />\r\n<br />\r\nWe understand the importance of clear communication and prompt responses, so please rest assured that we are working diligently to connect with you as soon as possible. In the meantime, if you have any additional information or specific requirements that you would like us to know, please feel free to share them with us.<br />\r\n<br />\r\nThank you once again for reaching out, and we look forward to speaking with you soon.', 'We greatly appreciate your interest in our product/service. Your inquiry has been received, and we want to assure you that we value your time and consideration. Our dedicated representative will personally reach out to you in the near future to provide you with the information you need and address any questions or concerns you may have.<br />\r\n<br />\r\nWe understand the importance of clear communication and prompt responses, so please rest assured that we are working diligently to connect with you as soon as possible. In the meantime, if you have any additional information or specific requirements that you would like us to know, please feel free to share them with us.<br />\r\n<br />\r\nThank you once again for reaching out, and we look forward to speaking with you soon.', 'delegateForm', 1, '0000-00-00 00:00:00'),
(261, 'After Subscribe Form Submit', 'admin', NULL, 'Dental Community ', 'webmaster', '', '', 'Thank you for Subscribe', 'Hello <span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">{{name}} ,</span><br />\r\n<br />\r\nThank you for subscribing! We greatly appreciate your interest and support. Our team will reach out to you as soon as possible to provide you with further information and assistance.<br />\r\n<br />\r\nIn the meantime, if you have any urgent questions or require immediate assistance, please don&#39;t hesitate to contact us directly. We&#39;re here to ensure that your experience with us is seamless and enjoyable.<br />\r\n<br />\r\nThank you once again for subscribing, and we look forward to connecting with you soon.', 'Hello <span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">{{name}} ,</span><br />\r\n<br />\r\nThank you for subscribing! We greatly appreciate your interest and support. Our team will reach out to you as soon as possible to provide you with further information and assistance.<br />\r\n<br />\r\nIn the meantime, if you have any urgent questions or require immediate assistance, please don&#39;t hesitate to contact us directly. We&#39;re here to ensure that your experience with us is seamless and enjoyable.<br />\r\n<br />\r\nThank you once again for subscribing, and we look forward to connecting with you soon.', 'subscribeEmail', 1, '0000-00-00 00:00:00'),
(262, 'Checkin', 'user', NULL, 'Dental Community ', 'webmaster', '', '', 'Good Morning Sunshine', 'Good morning,{{name}} !<br />\r\n<br />\r\nWe&#39;re thrilled to inform you that you&#39;ve successfully clocked in. Way to start the day on the right foot! We appreciate your punctuality and commitment.<br />\r\n<br />\r\nNow, get ready to seize the day and make the most of your time. If you have any questions or need any assistance, feel free to reach out. We&#39;re here to support you every step of the way.<br />\r\n<br />\r\nKeep up the fantastic work, and let&#39;s make today AWESOME!<br />\r\n<br />\r\nHave a wonderful day ahead!', 'Good morning,{{name}}&nbsp;!<br />\r\n<br />\r\nWe&#39;re thrilled to inform you that you&#39;ve successfully clocked in. Way to start the day on the right foot! We appreciate your punctuality and commitment.<br />\r\n<br />\r\nNow, get ready to seize the day and make the most of your time. If you have any questions or need any assistance, feel free to reach out. We&#39;re here to support you every step of the way.<br />\r\n<br />\r\nKeep up the fantastic work, and let&#39;s make today AWESOME!<br />\r\n<br />\r\nHave a wonderful day ahead!', 'checkin', 1, '0000-00-00 00:00:00'),
