INSERT INTO `pages` (`page_pk`, `slug`, `heading`, `sub_heading`, `short_desc`, `dsc`, `redirect`, `publish`, `special_page`, `comment`, `page_banner`, `dateTime`, `banner`) VALUES
(1, 'about-us', 'a:1:{s:7:\"English\";s:8:\"About Us\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:1510:\"<h2>Welcome to our <span> Dental Community Website!</span></h2>\r\n\r\n<p>We are a community of dental professionals and enthusiasts dedicated to promoting oral health and improving the quality of dental care for everyone. Our mission is to provide a platform where dental professionals can connect, share knowledge, and collaborate to advance the field of dentistry.</p>\r\n\r\n<p>Our website is designed to provide you with the latest news and updates in the dental industry, as well as resources and tools to help you improve your practice and enhance patient care. Whether you are a dentist, dental hygienist, dental assistant, or student, you will find valuable information and resources to support your career development and professional growth.</p>\r\n\r\n<p>Our community features a variety of forums, groups, and networking opportunities to connect with other dental professionals, share best practices, and discuss the latest trends and innovations in the field. You can also access a range of educational resources, including webinars, training videos, and online courses, to enhance your knowledge and skills.</p>\r\n\r\n<p>At our dental community website, we are committed to promoting the highest standards of patient care and ethical practice. We believe that collaboration, education, and innovation are key to achieving this goal, and we invite you to join us in advancing the field of dentistry.</p>\r\n\r\n<p>Thank you for visiting our website, and we look forward to your participation in our community!</p>\r\n\";}', '', 1, 0, 0, '', '2023-02-20 11:09:40', 'pages/2023/02/107-20230220095610-0-about-us-about-us-banner1.jpg'),
(2, 'contact-us', 'a:1:{s:7:\"English\";s:10:\"Contact Us\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:11:\"{{contact}}\";}', '', 1, 0, 0, '', '2023-03-03 06:09:56', 'pages/2023/02/645-20230222111906-0-contact-us-contact-us-banner.jpg'),
(3, 'booking', 'a:1:{s:7:\"English\";s:23:\"Book A Training Session\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:135:\"<div class=\"text-div\">If you would like to book a 121 training session of the AIOM software fill the form below.</div>\r\n{{bookingForm}}\";}', '', 1, 0, 0, '', '2023-03-04 09:26:53', 'pages/2023/03/576-20230304092653-0-booking-book-a-training-banner.jpg'),
(4, 'demo', 'a:1:{s:7:\"English\";s:4:\"Demo\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:278:\"<iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" allowfullscreen=\"\" frameborder=\"0\" height=\"500\" scrolling=\"no\" src=\"https://www.youtube.com/embed/X9J2ea8iNnM\" title=\"YouTube video player\" width=\"1000\"></iframe>\";}', '', 1, 0, 0, '', '2023-03-04 10:16:51', 'pages/2023/03/579-20230304101503-0-demo-about_banner1.jpg'),
(5, 'packages', 'a:1:{s:7:\"English\";s:8:\"packages\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:12:\"{{packages}}\";}', '', 1, 0, 0, '', '2023-03-04 10:42:29', 'pages/2023/03/861-20230304102116-0-packages-packages-banner1.jpg'),
(6, 'meet-our-team', 'a:1:{s:7:\"English\";s:13:\"Meet Our Team\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:1631:\"<div class=\"innerFlex mot_flex\" style=\"align-items: start;\">\r\n<div class=\"leftFlex\" style=\"width:30%\">\r\n<div class=\"img_holder\"><img alt=\"\" src=\"webImages/team_1.JPG\" /></div>\r\n</div>\r\n\r\n<div class=\"rightFlex\" style=\"width: 70%;\">\r\n<p>Dentistry is my passion and has been for as long as I can remember. Growing up I always knew it was in my future- what can I say. I just love teeth! I have been a licensed dental asistant for over 20 years, am an authorized OSHA outreach trainer, am certified in dental infection prevention and control and have over 10 years of experience working in dental staffing Along my dental journey have learned so much. but dental compliance has always been my passion. Working in dental staffing allowed me to work within hundreds of dental offices. Seeing the different levels of compliance standards from office to office fueled my drive to create an easy way for offices to make sure they are in compliance, allowing them to keep their staff and patients safe while reducing liability for themselves</p>\r\n\r\n<h1 style=\"margin-bottom: 0;\">Heidi Kephart</h1>\r\n<i class=\"text_italic\" style=\"width: 60%;\">Licensed Dental Assistant Authorized OSHA Outreach Trainer, CDIPC, CDSO</i>\r\n\r\n<div class=\"team_info\">\r\n<div class=\"infoflex\"><span class=\"icon_holder\"><span class=\"material-symbols-outlined\">mail</span> </span> <a href=\"mailto:heidi@dentalcommunitycompliance.com\">heidi@dentalcommunitycompliance.com</a></div>\r\n\r\n<div class=\"infoflex\"><span class=\"icon_holder\"><span class=\"material-symbols-outlined\">call</span> </span> <a href=\"tel:763.4309.7301\">763.4309.7301</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n\";}', '', 1, 0, 0, '', '2023-05-12 05:27:53', ''),
(7, 'services', 'a:1:{s:7:\"English\";s:8:\"Services\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:0:\"\";}', 'a:1:{s:7:\"English\";s:12:\"{{services}}\";}', '', 1, 0, 0, '', '2023-03-21 11:22:15', ''),
