(9, 'testing', 'a:1:{s:7:\"English\";s:7:\"Testing\";}', 'a:1:{s:7:\"English\";s:4:\"Demo\";}', 'a:1:{s:7:\"English\";s:19:\"This is for testing\";}', 'a:1:{s:7:\"English\";s:264:\"<h2 style=\"font-style: italic; text-align: center;\"><span style=\"color:#FF0000;\"><span style=\"font-size:26px;\">Comming Soon</span></span></h2>\r\n<img alt=\"\" src=\"https://php8.imdemo.xyz/dental_community/webImages/laptop.webp\" style=\"width: 807px; height: 500px;\" />\";}', '', 1, 0, 0, '', '2023-05-08 11:07:20', 'pages/2023/05/438-20230508120720-4-testing-640-x-443.png');
