(1, 4, 'Dental Anxiety Management', '60', 3, '{\"4\":[\"1\",\"2\",\"3\"]}', '', '<br />\r\nThe basic aim of this course is to understand some &#39;top tips&#39; for managing anxious dental patients.<br />\r\n&nbsp;', '<br />\r\nTo Understand dental anxiety, fear and phobia<br />\r\nRecognize signs of anxiety<br />\r\nUnderstand the range of possible coping strategies to employ<br />\r\n&nbsp;', '<br />\r\nList the options available to help anxious patients<br />\r\nUtilise some basic language, rapport and communication skills with anxious patients<br />\r\nUnderstand the training pathways available in dental anxiety management<br />\r\n&nbsp;', '<br />\r\nThis course reflect the GDC learning outcome A, B, C and D.<br />\r\n&nbsp;', '2023-04-01 08:29:05', 0),
