rgb(33, 37, 41); font-size: 16px; text-align: center;\" />\r\n<span style=\" font-size: 16px; text-align: center;\">Advisory support provided with a dedicated CQC Consultant - to include email/telephone responses to any staff member</span><br style=\"box-sizing: border-box; outline: none; font-family: poppinsregular; color: rgb(33, 37, 41); font-size: 16px; text-align: center;\" />\r\n<span style=\" font-size: 16px; text-align: center;\">Development & personalisation of all Practice Compliance documentation.</span><br style=\"box-sizing: border-box; outline: none; font-family: poppinsregular; color: rgb(33, 37, 41); font-size: 16px; text-align: center;\" />\r\n<span style=\"font-size: 16px; text-align: center;\">All updates of any changes to regulations/legislation and new policies</span><br style=\"box-sizing: border-box; outline: none; font-family: poppinsregular; color: rgb(33, 37, 41); font-size: 16px; text-align: center;\" />\r\n<span style=\" font-size: 16px; text-align: center;\">Access to All-In-one Management Software to manage and maintain your compliance with the support of Smart Dental Compliance and Training</span><br style=\"box-sizing: border-box; outline: none; font-family: poppinsregular; color: rgb(33, 37, 41); font-size: 16px; text-align: center;\" />\r\n<span style=\" font-size: 16px; text-align: center;\">General HR Support</span><br style=\"box-sizing: border-box; outline: none; font-family: poppinsregular; color: rgb(33, 37, 41); font-size: 16px; text-align: center;\" />\r\n<span style=\" font-size: 16px; text-align: center;\">General CPD Support</span><br style=\"box-sizing: border-box; outline: none; font-family: poppinsregular; color: rgb(33, 37, 41); font-size: 16px; text-align: center;\" />\r\n<span style=\" font-size: 16px; text-align: center;\">Onboarding Site Visit, dependent on the location<br />\r\nThis is a 12 month\'s contract, if you wish to cancel before the 12 months, you are required to pay the remaining balance. Your membership start and end date is present within the membership tab under your profileÂ </span><br style=\"box-sizing: border-box; outline: none; font-family: poppinsregular; color: rgb(33, 37, 41); font-size: 16px; text-align: center;\" />\r\n<span style=\" font-size: 16px; text-align: center;\">Should you wish to terminate the agreement after 12 months, two monthsâ€™ notice period is required.Â </span><br style=\"box-sizing: border-box; outline: none; font-family: poppinsregular; color: rgb(33, 37, 41); font-size: 16px; text-align: center;\" />\r\n<span style=\" font-size: 16px; text-align: center;\">After the completion of 12 months, if no notice is given, you would enter into another 12months agreement</span><br style=\"box-sizing: border-box; outline: none; font-family: poppinsregular; color: rgb(33, 37, 41); font-size: 16px; text-align: center;\" />\r\n<span style=\" font-size: 16px; text-align: center;\">If a direct debit is canceled before the completion of 12 months, you are required to pay the remaining balance, if you fail to do this, your information would be passed to the debt collection team.</span><br />\r\nÂ  --> <u><strong>Terms &amp; Conditions</strong></u><br />\r\n<br />\r\nI agree for Smart Dental Compliance &amp; Training (Company Number: 11714494 - Smart Compliance Training LTD) to provide a software to manage my dental compliance (relevant to the package of choice) and ensure all the compliance processes and systems are developed in line with CQC regulations. This will also include all advisory support to your practice team.<br />\r\n<br />\r\n<u><strong>Contract Agreement:</strong></u><br />\r\n<br />\r\n<strong>Period:</strong> 12 month contract (rolling if not notified of cancellation)<br />\r\n<br />\r\n<strong>Cooling off period:</strong> 5 days from registration<br />\r\n<br />\r\n<strong>Termination&amp; Notice:</strong>Should you wish to terminate the agreement after 12 months, one months&rsquo; notice period is required the month before your 12 month contract ends. After the completion of the first 12 months, if no notice is given, you will enter into another 12 months agreement.If you wish to terminate your contract within the 12 months, all remaining months must be paid.<br />\r\n<br />\r\n<strong>Direct Debit:</strong> Your first payment will leave your account 10 days from the date of sign up. If a direct debit is cancelled before the completion of you 12 month contract, you are required to pay the remaining balance up to 12 months.<br />\r\nDebt collectors &ndash; youoweusmoney &ndash; If DDs are cancelled without an agreement with the company, notice or payments are failed to be made your information will be passed onto the debt collection team. If there is a reason you cannot make payment please ensure you inform us at your earliest convenience.<br />\r\n<br />\r\n<u><strong>Data Protection:</strong></u><br />\r\n<br />\r\n<strong>The terms controller, processor, data subject, personal data, personal data breach and processing shall have the meaning given to them in the UK GDPR which has the meaning given to it in section 3 - 10 (as supplemented by section 205 - 4 of the Data Protection Act 2018.</strong><br />\r\nWe shall process the personal data we receive from you as processor on your behalf. You consent to (and shall procure all required consents, from your personnel representative and agents, in respect of all actions taken by us in connection with the processing of all personal data which we process in connection with this agreement.<br />\r\nYou will ensure that you have all necessary appropriate consents and notices in place to enable lawful transfer of any personal data to us and the lawful collection of the same by us for the duration.<br />\r\nProcessor and (Smart Dental Compliance) shall notify Company without undue delay upon Processor becoming aware of a Personal Data Breach affecting Company Personal Data, providing Company with sufficient information to allow the Company to meet any obligations to report or inform Data Subjects of the Personal Data Breach under the Data Protection Laws.<br />\r\n<br />\r\n<u><strong>Complaints Policy:</strong></u> This can be located on our website footer. Alternatively you can request it directly from customer services contactable at: info@smartdentalcompliance.com complaints can also be made via email to the following email address: info@smartdentalcompliance.com addressed to the &lsquo;Complaints Department&rsquo;. Letters can be posted to: Smart Dental Compliance &amp; Training Mitre House 66 Abbey Road Enfield EN1 2QN. You can reach us via telephone on 0800 689 1061<br />\r\n<br />\r\n<u><strong>Your Package:</strong></u> The following services are included as part of the All-In-One Management Software:<br />\r\n<br />\r\n<u><strong>SMART COMPLY:</strong></u><br />\r\n<br />\r\n1. Advisory support provided with a dedicated CQC Consultant - to include email/telephone responses to any staff member<br />\r\n2. Development &amp; personalization of all Practice Compliance documentation<br />\r\n3. All updates of any changes to regulations/legislation and new policies<br />\r\n4. Access to All-In-one Management Software compliance tab, templates and uploads to manage and maintain your compliance with the support of Smart Dental Compliance and Training consultant.<br />\r\n<br />\r\n<u><strong>SMART MANAGE what is listed at 1, 2, 3 and 4:</strong></u><br />\r\n<br />\r\n5. HR Employment Support&amp; HR Dashboard &ndash; unlimited users within your practice<br />\r\n6. CPD Platform<br />\r\n7. CQC Mock Inspection Audit for each site annually<br />\r\n8. Stock Management feature<br />\r\n9. Onboarding Site Visit, dependent on the location<br />\r\n10. 10% off on all our equipment services<br />\r\n11. 10% off on all our risk assessment services &amp; 10% on all our in house CPD Courses such as BLS<br />\r\n<br />\r\n<u><strong>SMART PLATINUM includes everything listed from 1 to 10 + additional below:</strong></u><br />\r\n<br />\r\nYour reports are uploaded directly on your practice software.<br />\r\n<br />\r\n- Health &amp; Safety Risk Assessment once a year<br />\r\n- Legionella Risk Assessment once a year<br />\r\n- Fire Risk Assessment once a year<br />\r\n- In House Training &ndash; BLS &amp; Cross Infection once a year<br />\r\n- Annual Autoclave PVI Testing once a year<br />\r\n- Compressor PVI Testing once a year<br />\r\n- PAT Testing when required<br />\r\n- 3 year service with RPA (Radiation Protection Advisor) optional*', '<img alt=\"Welcome To The Team GIF by memecandy - Find &amp; Share on GIPHY\" src=\"https://media2.giphy.com/media/fU4elxKlRsulB4Jy7w/giphy.gif\" /><br />\r\n<span style=\"font-size:16px;\"><strong>Welcome {{name}}, you have made a good choice, your new account is now ready.</strong></span><br />\r\n<br />\r\nYou can log in to your account using the following details:<br />\r\n<br />\r\nUsername:&nbsp;{{email}}<br />\r\nPin:&nbsp;{{pin}}<br />\r\nPassword:&nbsp;{{password}}<br />\r\nNext Step:<br />\r\n1. Your dedicated compliance consultant will contact you soon&nbsp;<br />\r\n2. We will send you an email with video links on how to get started&nbsp;<br />\r\n<br />\r\nIf at any point you get stuck, call us on 0800 689 1061&nbsp;<br />\r\n<br />\r\n<br />\r\n&nbsp;', 'accountCreateOnOrder', 1, '1/1/2015 3:52'),
