(253, 'Task sent back by user', 'user', '', 'Dental Community ', 'webmaster', '', '', 'Task Completed by {{name}}', 'It\'s done. Your team member has completed the task ({{title}}) allocated to them and sent it back to you. Log on to the All-In-one Management Software and check it out !!!It\'s done. Your team member has completed the task allocated to them and sent it back to you. Log on to the All-In-one Management Software and check it out !!!', 'It\'s done. Your team member has completed the task ({{title}}) allocated to them and sent it back to you. Log on to the All-In-one Management Software and check it out !!!It\'s done. Your team member has completed the task allocated to them and sent it back to you. Log on to the All-In-one Management Software and check it out !!!', 'event', 1, '12/31/2014 18:48'),
(254, '1st Warning', 'user', '', 'Dental Community ', 'webmaster', '', '', 'Compliance Health in Danger', 'You in danger gurrl. Your compliance health meter is in red. Let&rsquo;s keep out of the red.<br />\r\n<br />\r\nLog on to the software and update your compliance activities through the activity calendar. Download the outstanding compliance activities from the compliance templates, complete and upload on the activity calendar. Or simply click on the compliance activity and fill the electronic form.<br />\r\n<br />\r\nRemember &lsquo;Best Practice Starts Here&rsquo;', 'You in danger gurrl. Your compliance health meter is in red. Let&rsquo;s keep out of the red.<br />\r\n<br />\r\nLog on to the software and update your compliance activities through the activity calendar. Download the outstanding compliance activities from the compliance templates, complete and upload on the activity calendar. Or simply click on the compliance activity and fill the electronic form.<br />\r\n<br />\r\nRemember &lsquo;Best Practice Starts Here&rsquo;', '1warn', 1, '12/31/2014 18:48'),
(255, '2nd Warning', 'user', '', 'Dental Community ', 'webmaster', '', '', 'Compliance Health in Danger', 'Hulk Out! Your compliance health meter is still in the red. Time to be a hero.<br />\r\n<br />\r\nWhat does this mean?<br />\r\nLog on to the software and update your compliance activities through the activity calendar. Download the outstanding compliance activities from the compliance templates, complete and upload on the activity calendar. Or simply click on the compliance activity and fill the electronic form.', 'Hulk Out! Your compliance health meter is still in the red. Time to be a hero.<br />\r\n<br />\r\nWhat does this mean?<br />\r\nLog on to the software and update your compliance activities through the activity calendar. Download the outstanding compliance activities from the compliance templates, complete and upload on the activity calendar. Or simply click on the compliance activity and fill the electronic form.', '2warn', 1, '12/31/2014 18:48'),
(256, '3rd Warning', 'user', '', 'Dental Community ', 'webmaster', '', '', 'Compliance Health in Danger', 'Wake Up! Your compliance health meter has been in the red for 3 weeks. Be near your phone.<br />\r\n<br />\r\nNext Step :<br />\r\nSince your compliance, health has been in red for 1 month, it&rsquo;s time for us to give you a call and just check on you. A notification is also being sent to the practice owner to see if they can help.', 'Wake Up! Your compliance health meter has been in the red for 3 weeks. Be near your phone.<br />\r\n<br />\r\nNext Step :<br />\r\nSince your compliance, health has been in red for 1 month, it&rsquo;s time for us to give you a call and just check on you. A notification is also being sent to the practice owner to see if they can help.', '3warn', 1, '12/31/2014 18:48'),
(257, 'Message To Owners', 'admin', '', 'Dental Community ', 'webmaster', '', '', 'Practice\'s Compliance Health ', 'This is an update from the All-In-One Management Software, your practice compliance health hasn&rsquo;t been great for the last 4 weeks.<br />\r\n<br />\r\nWe have sent emails to the practice manager to check on this and also given a courtesy call to help them.<br />\r\n<br />\r\nThey need your help and skills. Schedule time with them and resolve all outstanding issued immediately.', 'This is an update from the All-In-One Management Software, your practice compliance health hasn&rsquo;t been great for the last 4 weeks.<br />\r\n<br />\r\nWe have sent emails to the practice manager to check on this and also given a courtesy call to help them.<br />\r\n<br />\r\nThey need your help and skills. Schedule time with them and resolve all outstanding issued immediately.', 'mto', 1, '12/31/2014 18:48'),
(258, 'Performance Review', 'admin', '', 'Dental Community ', 'webmaster', '', '', 'Performance Review', 'Hiya !!!<br />\r\n<br />\r\nYou have been set up to fill a Peer Review on your colleague.How exciting right !!! Log on to All-In-One Management Software and follow the instruction form the Dashboard.Easy !!!', 'Hiya !!!<br />\r\n<br />\r\nYou have been set up to fill a Peer Review on your colleague.How exciting right !!! Log on to All-In-One Management Software and follow the instruction form the Dashboard.Easy !!!', 'review', 1, '12/31/2014 18:48'),
