(283, 'After Inquiry Form Submit', 'admin', '', 'Dental Community ', 'webmaster', '', '', 'Thank you for your request', 'Hello&nbsp;<span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">{{name}} ,</span><br />\r\n<br />\r\nThank you for your request!<br />\r\nWe will contact you as soon as possible.', 'Hello&nbsp;<span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">{{name}} ,</span><br />\r\n<br />\r\nThank you for your request!<br />\r\nWe will contact you as soon as possible.', 'inquiryFormSubmit', 1, '12/31/2014 18:48'),
