(285, 'someDayOfSignup1', 'admin', '0', 'Dental Community ', 'webmaster', '', '', 'Welcome to the SmartManage', '<div style=\"background:#e6e6e680;\">\r\n<div style=\"text-align: center;background:#0097bc;\"><br />\r\n<img src=\"https://smartdentalcompliance.com/webImages/logoSS.png\" /><br />\r\n&nbsp;</div>\r\n\r\n<div style=\"max-width:70%;margin:0px auto;display:block;background: #fff;padding: 0 20px 30px;\">\r\n<div style=\"text-align: center;\"><br />\r\n<span style=\"font-size:28px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong>Welcome to Smart Dental Compliance</strong></span></span></div>\r\n\r\n<div><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Hi,</span></span></div>\r\n<br />\r\n<span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Welcome to the SmartManage</span></span><br />\r\n<br />\r\n<span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Thank you for signing up to the SmartManage Software. We are so happy you decided to try us (seriously, you should see us right now-we&rsquo;re grinning from ear to ear).</span></span><br />\r\n<br />\r\n<span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">A few things you may want to know:</span></span>\r\n\r\n<h1><span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong>Your account</strong></span></span></h1>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Below is the link to your SmartManage account. We recommend downloading it for future reference. Remember, you username is your email address. You can reset the password once you login in.</span></span><br />\r\n<br />\r\n&nbsp; <a href=\"www.smartdentalcompliance.com/login\">www.smartdentalcompliance.com/login</a></p>\r\n\r\n<hr />\r\n<h1><br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family: tahoma, geneva, sans-serif;\"><strong>Getting Started</strong></span></span></h1>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">To get started you need to complete the initial compliance health check form, which is super easy. This is just like a mock inspection of the practice. Make sure you answer the questions accurately.</span></span></p>\r\n&nbsp;\r\n\r\n<hr />\r\n<h1><br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family: tahoma, geneva, sans-serif;\"><strong>Schedule an onboarding </strong></span></span></h1>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">We want you to have the best possible experience with us. That&rsquo;s why we provide, free one-to-one onboarding sessions to help you feel comfortable and confident with the software. To schedule your onboarding, click the button below.</span></span></p>\r\n&nbsp;\r\n\r\n<p><a href=\"https://smartdentalcompliance.com/page-general-forms&amp;form=3\"><span style=\"color:#0097bc;\"><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Book an onboarding </span></span></span></a></p>\r\n&nbsp;\r\n\r\n<div style=\"text-align: center;\"><span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">&nbsp;</span></span>\r\n\r\n<div style=\"background-color: #fcc429;font-size: 15px;height: 200px;color: #fff;position: relative;display: inline-block;vertical-align: middle;cursor: pointer;overflow: hidden;text-align: center;border: 1px solid #ff8c93;transition: 0.3s;width:100%\"><br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong><span style=\"font-size:36px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Have a question? Get In touch.<br />\r\n<a href=\"tel:0800 689 1061\" style=\"color:white;text-decoration:none;font-size:20px;\">0800 689 1061</a> | <a href=\"mailto:info@smartdentalcompliance.com\" style=\"color:white;text-decoration:none;font-size:20px;\">info@smartdentalcompliance.com</a></span></span></strong></span></span></div>\r\n<br />\r\n&nbsp;</div>\r\n<br />\r\n<br />\r\nWe hope you love the software, and share it with other practices. We offer 2 months free subscription and a luxury hamper if the referred practice sign up.<br />\r\n<br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Thank You,</span></span><br />\r\n<br />\r\n<span style=\"font-size:22px;\"><span style=\"font-family:lucida sans unicode,lucida grande,sans-serif;\"><strong>Smart Dental Compliance Team</strong></span></span></div>\r\n</div>\r\n', '', 'someDayOfSignup1', 1, '12/31/2014 18:48'),
(286, 'someDayOfSignup5', 'admin', '0', 'Dental Community ', 'webmaster', '', '', 'Navigating your account', '<div style=\"background:#e6e6e680;\">\r\n<div style=\"text-align: center;background:#0097bc;\"><br />\r\n<img src=\"https://smartdentalcompliance.com/webImages/logoSS.png\" /><br />\r\n&nbsp;</div>\r\n\r\n<div style=\"max-width:70%;margin:0px auto;display:block;background: #fff;padding: 0 20px 30px;\">\r\n<div style=\"text-align: center;\"><br />\r\n<span style=\"font-size:28px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong>Navigating your account </strong></span></span></div>\r\n\r\n<div><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Hi,</span></span></div>\r\n<br />\r\n<span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Thank you for signing up to the SmartManage Software. The fastest growing management software loved by 1000+ of practice managers. I am reaching out to make sure you have managed to log in to the software. If you haven&rsquo;t had an onboarding session with our compliance consultant you book this by clicking on the below link;</span></span><br />\r\n&nbsp;\r\n<div style=\"text-align: center;\">&nbsp; <strong><span style=\"font-size:36px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><a href=\"https://smartdentalcompliance.com/page-general-forms&amp;form=3\" style=\"text-decoration: none;background-color: #d86168;font-size: 15px;padding: 5px 20px;border-radius: 30px;color: #fff;position: relative;display: inline-block;vertical-align: middle;cursor: pointer;overflow: hidden;width: auto;text-align: center;border: 1px solid #ff8c93;transition: 0.3s;margin-right: 5px;\">Book a 15-minute onboarding session</a></span></span></strong></div>\r\n\r\n<div style=\"text-align: center;\"><span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">&nbsp;</span></span>\r\n\r\n<div style=\"background-color: #fcc429;font-size: 15px;height: 200px;color: #fff;position: relative;display: inline-block;vertical-align: middle;cursor: pointer;overflow: hidden;text-align: center;border: 1px solid #ff8c93;transition: 0.3s;width:100%\"><br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong><span style=\"font-size:36px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Have a question? Get In touch.<br />\r\n<a href=\"tel:0800 689 1061\" style=\"color:white;text-decoration:none;font-size:20px;\">0800 689 1061</a> | <a href=\"mailto:info@smartdentalcompliance.com\" style=\"color:white;text-decoration:none;font-size:20px;\">info@smartdentalcompliance.com</a></span></span></strong></span></span></div>\r\n<br />\r\n&nbsp;</div>\r\n<br />\r\n<br />\r\n<span style=\"font-family: tahoma, geneva, sans-serif; font-size: 16px;\">I look forward to speaking to you, </span><br />\r\n<br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Best Regards</span></span><br />\r\n<br />\r\n<span style=\"font-size:22px;\"><span style=\"font-family:lucida sans unicode,lucida grande,sans-serif;\"><strong>Smart Dental Compliance Team</strong></span></span></div>\r\n</div>\r\n', '', 'someDayOfSignup5', 1, '12/31/2014 18:48'),
(287, 'someDayOfSignup10', 'admin', '0', 'Dental Community ', 'webmaster', '', '', 'Get the most out your subscription', '<div style=\"background:#e6e6e680;\">\r\n<div style=\"text-align: center;background:#0097bc;\"><br />\r\n<img src=\"https://smartdentalcompliance.com/webImages/logoSS.png\" /><br />\r\n&nbsp;</div>\r\n\r\n<div style=\"max-width:70%;margin:0px auto;display:block;background: #fff;padding: 0 20px 30px;\">\r\n<div style=\"text-align: center;\"><br />\r\n<span style=\"font-size:28px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong>Get the most out your subscription</strong></span></span></div>\r\n<span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">We hope you are enjoying the software. You may have noticed the software has a lot of exciting features &ndash; and if you haven&rsquo;t discovered them all yet, that&rsquo;s OK. The software allows you and your team to complete our interactive, fun, bitesize cpd courses. Under the hr management tab you can create quick and easy rotas and publish them to your team. We even have a stock management dashboard which would allow you to keep on track of your stock. For each features, we have created easy get started videos, click below to watch these </span></span>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><a href=\"https://smartdentalcompliance.com/dashboard\"><span style=\"color:#0097bc;\">- Get started with compliance</span></a><br />\r\n<a href=\"https://smartdentalcompliance.com/cpd\"><span style=\"color:#0097bc;\">- Get started with CPD dashboard</span></a><br />\r\n<a href=\"https://smartdentalcompliance.com/resources?category=HR-Management\"><span style=\"color:#0097bc;\">- Get started with HR management</span></a><br />\r\n<a href=\"https://smartdentalcompliance.com/stock\"><span style=\"color:#0097bc;\">- Get started with stock management </span></a></span></span></p>\r\n&nbsp;\r\n\r\n<div style=\"text-align: center;\"><span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">&nbsp;</span></span>\r\n\r\n<div style=\"background-color: #fcc429;font-size: 15px;height: 200px;color: #fff;position: relative;display: inline-block;vertical-align: middle;cursor: pointer;overflow: hidden;text-align: center;border: 1px solid #ff8c93;transition: 0.3s;width:100%\"><br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong><span style=\"font-size:36px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Have a question? Get In touch.<br />\r\n<a href=\"tel:0800 689 1061\" style=\"color:white;text-decoration:none;font-size:20px;\">0800 689 1061</a> | <a href=\"mailto:info@smartdentalcompliance.com\" style=\"color:white;text-decoration:none;font-size:20px;\">info@smartdentalcompliance.com</a></span></span></strong></span></span></div>\r\n<br />\r\n&nbsp;</div>\r\n<br />\r\n<br />\r\n<span style=\"font-family: tahoma, geneva, sans-serif; font-size: 16px;\">Have a great day,</span><br />\r\n<br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Many Thanks,</span></span><br />\r\n<br />\r\n<span style=\"font-size:22px;\"><span style=\"font-family:lucida sans unicode,lucida grande,sans-serif;\"><strong>Smart Dental Compliance Team</strong></span></span></div>\r\n</div>\r\n', '', 'someDayOfSignup10', 1, '12/31/2014 18:48'),
(288, 'someDayOfSignup15', 'admin', '0', 'Dental Community ', 'webmaster', '', '', 'Do you know there is an App ?', '<div style=\"background:#e6e6e680;\">\r\n<div style=\"text-align: center;background:#0097bc;\"><br />\r\n<img src=\"https://smartdentalcompliance.com/webImages/logoSS.png\" /><br />\r\n&nbsp;</div>\r\n\r\n<div style=\"max-width:70%;margin:0px auto;display:block;background: #fff;padding: 0 20px 30px;\">\r\n<div style=\"text-align: center;\"><br />\r\n<span style=\"font-size:28px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong>Do you know there is an App ?</strong></span></span></div>\r\n\r\n<div><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Hi,</span></span></div>\r\n<br />\r\n<span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">To ensure the software is user friendly and easy accessible we have a web based app which can be downloaded on your smart phones or practice ipad. The app would allow quick access to everything you see on the software. </span></span>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">It also allows you upload picture evidence when you click on the upload button anywhere on the software. If you or the team haven&rsquo;t downloaded the app, here is video link on how to download this:</span></span><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><a href=\"https://www.youtube.com/watch?v=Y9OjbO6fQoc\" target=\"_blank\"><span style=\"color:#0097bc;\">- App for Android</span></a><br />\r\n<a href=\"https://www.youtube.com/watch?v=L9fqGrnABhY\" target=\"_blank\"><span style=\"color:#0097bc;\">- App for Apple</span></a></span></span></p>\r\n&nbsp;\r\n\r\n<div style=\"text-align: center;\"><span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">&nbsp;</span></span>\r\n\r\n<div style=\"background-color: #fcc429;font-size: 15px;height: 200px;color: #fff;position: relative;display: inline-block;vertical-align: middle;cursor: pointer;overflow: hidden;text-align: center;border: 1px solid #ff8c93;transition: 0.3s;width:100%\"><br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong><span style=\"font-size:36px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Have a question? Get In touch.<br />\r\n<a href=\"tel:0800 689 1061\" style=\"color:white;text-decoration:none;font-size:20px;\">0800 689 1061</a> | <a href=\"mailto:info@smartdentalcompliance.com\" style=\"color:white;text-decoration:none;font-size:20px;\">info@smartdentalcompliance.com</a></span></span></strong></span></span></div>\r\n<br />\r\n&nbsp;</div>\r\n<br />\r\n<br />\r\n<span style=\"font-family: tahoma, geneva, sans-serif; font-size: 16px;\">Have a great day,</span><br />\r\n<br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Many Thanks,</span></span><br />\r\n<br />\r\n<span style=\"font-size:22px;\"><span style=\"font-family:lucida sans unicode,lucida grande,sans-serif;\"><strong>Smart Dental Compliance Team</strong></span></span></div>\r\n</div>\r\n', '', 'someDayOfSignup15', 1, '12/31/2014 18:48'),
(289, 'someDayOfSignup90', 'admin', '0', 'Dental Community ', 'webmaster', '', '', 'Itâ€™s been few months', '<div style=\"background:#e6e6e680;\">\r\n<div style=\"text-align: center;background:#0097bc;\"><br />\r\n<img src=\"https://smartdentalcompliance.com/webImages/logoSS.png\" /><br />\r\n&nbsp;</div>\r\n\r\n<div style=\"max-width:70%;margin:0px auto;display:block;background: #fff;padding: 0 20px 30px;\">\r\n<div style=\"text-align: center;\"><br />\r\n<span style=\"font-size:28px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong>It&rsquo;s been few months</strong></span></span></div>\r\n\r\n<div><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Hi,</span></span></div>\r\n<br />\r\n<span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">How&rsquo;s everything going ?</span></span>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">We hope you are finding the system useful. Have you noticed we often add additional features to the software based on your opinions and suggestions. If you have some great ideas why not share with us using our request a feature page </span></span><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<hr />\r\n<h1><br />\r\n<span style=\"font-size:16px;\"><a href=\"https://smartdentalcompliance.com/page-feature-form\"><span style=\"color:#0097bc;\"><span style=\"font-family: tahoma, geneva, sans-serif;\"><strong>Request a feature</strong></span></span></a></span></h1>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">We also offer training and support for your team on using the software, so if your still not getting the hang don&rsquo;t just leave it, give us a shout, book a 10 minutes catch up call with one of our consultants.</span></span></p>\r\n&nbsp;\r\n\r\n<h1><br />\r\n<span style=\"font-size:16px;\"><a href=\"https://smartdentalcompliance.com/page-general-forms&amp;form=2\"><span style=\"color:#0097bc;\"><span style=\"font-family: tahoma, geneva, sans-serif;\"><strong>Book 10 minutes catch up call </strong></span></span></a></span></h1>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Speak to you soon </span></span></p>\r\n&nbsp;\r\n\r\n<div style=\"text-align: center;\"><span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">&nbsp;</span></span>\r\n\r\n<div style=\"background-color: #fcc429;font-size: 15px;height: 200px;color: #fff;position: relative;display: inline-block;vertical-align: middle;cursor: pointer;overflow: hidden;text-align: center;border: 1px solid #ff8c93;transition: 0.3s;width:100%\"><br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong><span style=\"font-size:36px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Have a question? Get In touch.<br />\r\n<a href=\"tel:0800 689 1061\" style=\"color:white;text-decoration:none;font-size:20px;\">0800 689 1061</a> | <a href=\"mailto:info@smartdentalcompliance.com\" style=\"color:white;text-decoration:none;font-size:20px;\">info@smartdentalcompliance.com</a></span></span></strong></span></span></div>\r\n<br />\r\n&nbsp;</div>\r\n<br />\r\n<br />\r\n<span style=\"font-family: tahoma, geneva, sans-serif; font-size: 16px;\">Have a great day,</span><br />\r\n<br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Many Thanks,</span></span><br />\r\n<br />\r\n<span style=\"font-size:22px;\"><span style=\"font-family:lucida sans unicode,lucida grande,sans-serif;\"><strong>Smart Dental Compliance Team</strong></span></span></div>\r\n</div>\r\n', '', 'someDayOfSignup90', 1, '12/31/2014 18:48'),
(290, 'someDayOfSignup180', 'admin', '0', 'Dental Community ', 'webmaster', '', '', 'Platinum Compliance Package ', '<div style=\"background:#e6e6e680;\">\r\n<div style=\"text-align: center;background:#0097bc;\"><br />\r\n<img src=\"https://smartdentalcompliance.com/webImages/logoSS.png\" /><br />\r\n&nbsp;</div>\r\n\r\n<div style=\"max-width:70%;margin:0px auto;display:block;background: #fff;padding: 0 20px 30px;\">\r\n<div style=\"text-align: center;\"><br />\r\n<span style=\"font-size:28px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong>Platinum Compliance Package </strong></span></span></div>\r\n\r\n<div><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Hi,</span></span></div>\r\n<br />\r\n<span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Hope you are doing great. Have you thought about upgrading to our platinum compliance package. It&rsquo;s time consuming trying to find companies, who offer equipment servicing, rpa service or even risk assessments. Comparing quotes, booking dates, no shows, if these are your problems why not try upgrading to our platinum compliance package which includes:</span></span><br />\r\n&nbsp;\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">- Annual subscription of the SmartManage Package<br />\r\n- Fire Risk Assessment<br />\r\n- Legionella Risk Assessment<br />\r\n- PAT Testing - Autoclave PVI<br />\r\n- Compressor PVI<br />\r\n- In house BLS/CPR Training<br />\r\n- In house Cross Infection training<br />\r\n- RPA Service<br />\r\n- Annual Mock Inspection </span></span><br />\r\n<br />\r\n<span style=\"font-family: tahoma, geneva, sans-serif; font-size: 14px;\">You can get all the above for an extra &pound;150 per month. To sign up or get more information, simple call us on 0800 689 1061 or click below</span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><span style=\"color:#0097bc;\">- </span><a href=\"https://smartdentalcompliance.com/page-contact\"><span style=\"color:#0097bc;\">I want to upgrade</span></a> </span></span><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<div style=\"text-align: center;\"><span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">&nbsp;</span></span>\r\n\r\n<div style=\"background-color: #fcc429;font-size: 15px;height: 200px;color: #fff;position: relative;display: inline-block;vertical-align: middle;cursor: pointer;overflow: hidden;text-align: center;border: 1px solid #ff8c93;transition: 0.3s;width:100%\"><br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong><span style=\"font-size:36px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Have a question? Get In touch.<br />\r\n<a href=\"tel:0800 689 1061\" style=\"color:white;text-decoration:none;font-size:20px;\">0800 689 1061</a> | <a href=\"mailto:info@smartdentalcompliance.com\" style=\"color:white;text-decoration:none;font-size:20px;\">info@smartdentalcompliance.com</a></span></span></strong></span></span></div>\r\n<br />\r\n&nbsp;</div>\r\n<br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Best Wishes,</span></span><br />\r\n<br />\r\n<span style=\"font-size:22px;\"><span style=\"font-family:lucida sans unicode,lucida grande,sans-serif;\"><strong>Smart Dental Compliance Team</strong></span></span></div>\r\n</div>\r\n', '', 'someDayOfSignup180', 1, '12/31/2014 18:48');
