(291, 'someDayOfSignup365', 'admin', '0', 'Dental Community ', 'webmaster', '', '', 'Happy 1st anniversary', '<div style=\"background:#e6e6e680;\">\r\n<div style=\"text-align: center;background:#0097bc;\"><br />\r\n<img src=\"https://smartdentalcompliance.com/webImages/logoSS.png\" /><br />\r\n&nbsp;</div>\r\n\r\n<div style=\"max-width:70%;margin:0px auto;display:block;background: #fff;padding: 0 20px 30px;\">\r\n<div style=\"text-align: center;\"><br />\r\n<span style=\"font-size:28px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong>Happy 1st anniversary</strong></span></span></div>\r\n\r\n<div><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Hi,</span></span></div>\r\n<br />\r\n<span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">We are super happy today, its our first anniversary together. We want to say thank you for being with us, through thick and thin. We know how busy life can get but remember we are always here for you. If you are still struggling to use the software, and want an update of our latest feature, why not give us a shout.</span></span>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">- <a href=\"https://smartdentalcompliance.com/page-general-forms&amp;form=1\">Book a call</a> </span></span><br />\r\n<br />\r\n<span style=\"font-family: tahoma, geneva, sans-serif; font-size: 14px;\">We hope to continue supporting you and your team with the SmartManage Software</span></p>\r\n\r\n<div style=\"text-align: center;\"><span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">&nbsp;</span></span>\r\n\r\n<div style=\"background-color: #fcc429;font-size: 15px;height: 200px;color: #fff;position: relative;display: inline-block;vertical-align: middle;cursor: pointer;overflow: hidden;text-align: center;border: 1px solid #ff8c93;transition: 0.3s;width:100%\"><br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\"><strong><span style=\"font-size:36px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Have a question? Get In touch.<br />\r\n<a href=\"tel:0800 689 1061\" style=\"color:white;text-decoration:none;font-size:20px;\">0800 689 1061</a> | <a href=\"mailto:info@smartdentalcompliance.com\" style=\"color:white;text-decoration:none;font-size:20px;\">info@smartdentalcompliance.com</a></span></span></strong></span></span></div>\r\n<br />\r\n&nbsp;</div>\r\n<br />\r\n<span style=\"font-size:16px;\"><span style=\"font-family:tahoma,geneva,sans-serif;\">Best Wishes,</span></span><br />\r\n<br />\r\n<span style=\"font-size:22px;\"><span style=\"font-family:lucida sans unicode,lucida grande,sans-serif;\"><strong>Smart Dental Compliance Team</strong></span></span></div>\r\n</div>\r\n', '', 'someDayOfSignup365', 1, '12/31/2014 18:48'),
