(297, 'Webinar Form', 'admin', '', 'Dental Community ', 'webmaster', '', '', 'Webinar Form', 'Dear {{name}}<br />\r\nThanks for your interest. You are now registered in webinar:{{webinarTitle}}.<br />\r\nyour zoom link: {{zoomLink}}', 'Thanks for your interest. Our representative will get in touch with you.', 'WebinarForm', 1, '12/31/2014 18:48'),
(298, 'Mock Action Plan', 'user', '', 'Dental Community ', 'webmaster', '', '', 'Welcome Mock Plan', 'Hello <span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">{{name}} ,</span><br />\r\n<br />\r\nMock Action Plan Added for you. Log on to the AIOM Software and check it out !!!', 'Mock Action Plan Added for you. Log on to the AIOM Software and check it out !!!', 'mockactionplan', 1, '8/30/2022 2:48'),
(299, 'Complete CPD Course', 'user', '', 'Dental Community ', 'webmaster', '', '', 'Complete CPD Course', 'Hello <span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">{{name}} ,</span><br />\r\n<br />\r\nWell Done !!! You completed the course, don\'t forget to save or download your certificate <br />', 'Well Done !!! You completed the course, don\'t forget to save or download your certificate ', 'completecpd', 1, '8/30/2022 2:48'),
(300, 'Intranet New Post', 'user', '', 'Dental Community ', 'webmaster', '', '', 'New Post on Intranet', 'Hello <span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">{{name}} ,</span><br />\r\n<br />A New Post on Intranet for you. Log on to the AIOM Software and check it out !!!', 'A New Post on Intranet for you. Log on to the AIOM Software and check it out !!!', 'intranewpost', 1, '8/30/2022 2:48'),
(301, 'Expire Certificate', 'user', '', 'Dental Community ', 'webmaster', '', '', 'Document About To Expire', 'Hello <span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">{{name}} ,</span><br />\r\n<br />\r\nYour {{title}} is about to expire please log in to SDC to take your new course  <br />', 'Your <b>{{title}}</b> is about to expire please log in to AIOM to update.', 'certificateExpire', 1, '8/30/2022 2:48'),
(302, 'Not Logged In Last 30 Days', 'user', '', 'Dental Community ', 'webmaster', '', '', 'Not Logged In Last 30 Days', 'Dear <span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">{{name}} ,</span><br />\r\n<br /> , Our system shows you haven\'t logged into the AIOM software within the last 30 days. We highly recommend in order to keep on top of your compliance activities, you log in on a regular basis. If you need support on how to log in to your account please contact us on 0800 689 1061', 'Dear {{name}}, Our system shows you haven\'t logged into the AIOM software within the last 30 days. We highly recommend in order to keep on top of your compliance activities, you log in on a regular basis. If you need support on how to log in to your account please contact us on 0800 689 1061', 'notlogin30', 1, '8/30/2022 2:48'),
(303, 'Task created and assigned via My event ', 'user', '', 'Dental Community ', 'webmaster', '', '', 'Task created and assigned via My event ', 'Dear <span style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">{{name}} ,</span><br />\r\n<br /> , A task has been created and assigned to you, please log on to the AIOM software and check out the task ', 'A task has been created and assigned to you, please log on to the AIOM and check out the task ', 'myeventtasks', 1, '8/30/2022 2:48'),
